import React from "react";
import info_success from '../images/info_success.svg';
import info_fail from '../images/info_fail.svg';

function InfoTooltip() {
  return (
    <div className="info-reg">
      <img src={info_success} alt="Успешно" />
      <div className="info-reg__icon info-reg__icon_success"></div>
      <p className="info-reg__text">Вы успешно зарегистрировались!</p>
      <button
        className="popup__close popup__close-button popup__close-button_place_info-reg"
        type="button"
      ></button>
    </div>
  );
}

export default InfoTooltip;
